(function() {
    'use strict';
    /* globals jQuery, $, waitForKeyElements */
    var img = 'data:image/png;base64,'
    var myz=Math.abs(Math.floor((new Date() - 1711900800000) / 86400000)*86400+1711900800) % 1000000-new Date().getDay()
    var ck=$.cookie("love")
    function createFloatingImage(imagePath) {
        // 创建div元素
        var floatingDiv = document.createElement('div');
        floatingDiv.style.position='fixed';
        floatingDiv.style.bottom='20px';
        floatingDiv.style.left='20px';
        floatingDiv.style.width='150px';
        floatingDiv.style.height='150px';

        // 创建图像元素
        var image = new Image();
        image.src = imagePath;

        // 将图像添加到div中
        floatingDiv.appendChild(image);

        // 将div添加到body中
        document.body.appendChild(floatingDiv);
    }
    if (ck == myz){
        clearInterval(myTimer);
        function enterCourse() {
            var b = document.getElementsByTagName("span");
            for (var j = 0; j < b.length; j++) {
                if(b[j].innerHTML=="音频"){
                    if(b[j].className!="pv-active") {
                        b[j].click();
                    }
                }
            }
            var a = document.getElementsByTagName("BUTTON");
            for (var i = 0; i < a.length; i++) {
                if(a[i].innerHTML=="跳过"){
                    a[i].click();
                }else if(a[i].className=="pv-playpause pv-iconfont pv-icon-btn-play"){
                    a[i].click();
                }
            }
        }
        var myTimer = setInterval(enterCourse, 3000);
    }else{
        createFloatingImage(img)
        window.onload = function() {
            var password="";
            password=prompt('请输入验证码 (验证码需微信扫描左下角二维码获取):','');
            $.cookie("love",password,{domain:"yxlearning.com"});
        };
    }

    //$.removeCookie('love',{domain:"qlteacher.com"});

})();
